import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom'; // Import Routes
import ShowReelList from './components/ShowReelList';
import CreateShowReel from './components/ShowReelForm';

const App = () => {
  return (
    <Router>
      <div>
        <h1>Show Reel Application</h1>
        <nav>
          <ul>
            <li>
              <NavLink to="/show_reels">Show All Reels</NavLink>
            </li>
            <li>
              <NavLink to="/create_reel">Create Reel</NavLink>
            </li>
          </ul>
        </nav>
        <Routes> {/* Replace Route with Routes */}
          <Route path="/show_reels" element={<ShowReelList />} />
          <Route path="/create_reel" element={<CreateShowReel />} />
        </Routes> {/* Wrap Routes around Route components */}
      </div>
    </Router>
  );
};

export default App;
